-- ----------------------------
-- Table structure for books
-- ----------------------------
DROP TABLE IF EXISTS `books`;
CREATE TABLE `books` (
`id`  int(10) UNSIGNED NOT NULL AUTO_INCREMENT ,
`book_time`  date NULL DEFAULT NULL ,
`total_price`  int(11) NULL DEFAULT NULL ,
`number_of_ticket`  int(11) NULL DEFAULT NULL ,
`number_phone`  int(11) NULL DEFAULT NULL ,
`address`  varchar(191) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL ,
`member_id`  int(10) UNSIGNED NULL DEFAULT NULL ,
`event_id`  int(10) UNSIGNED NULL DEFAULT NULL ,
`status`  tinyint(4) NOT NULL DEFAULT 0 ,
`ship_form`  tinyint(4) NOT NULL DEFAULT 0 ,
`created_at`  timestamp NULL DEFAULT NULL ,
`updated_at`  timestamp NULL DEFAULT NULL ,
PRIMARY KEY (`id`)
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8mb4 COLLATE=utf8mb4_unicode_ci
AUTO_INCREMENT=101

;

